const MealPlan = ({item}) => {
    return (
        <Box>

        <Divider sx={{bgcolor:'white'}}/>
        <ListItem sx={{backgroundColor:'primary.main',border:'solid 3px',borderColor:'primary.main',my:'0.5rem',borderRadius:'10px',mx:'auto',width:'80%'}}
